import React from "react";
import "./Fos.css";

const faszsagok = [
  "pina",
  "fasz",
  "fos",
  "geci",
  "pisa",
  "segglyuk",
  seggpina,
  hugyospite,
  gecilyuk,
  zsido,
];

const handleClick = () => {
  const segg = document.createElement("div");
  segg.innerHTML = "segg";
  document.body.appendChild(segg);
};

const Fos = (props) => {
  return (
    <button onClick={handleClick} className="fos">
      {props.children}
    </button>
  );
};

export default Fos;
